import axios from "axios";

const baseUrl = "https://proj-admin-c0620-default-rtdb.firebaseio.com/";

export const getData = async () => {
  try {
    const { data } = await axios.get(baseUrl);
    return data;
  } catch (err) {
    throw err;
  }
};
